import React from 'react';
import Slider from 'react-slick';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';
import "../Style/NineCardSlickTrack"

const NineCardSlickTrack = () => {
  // Sample data for the cards, you can replace this with your actual data
  const cardsData = [
    { id: 1, title: 'Card 1' },
    { id: 2, title: 'Card 2' },
    { id: 3, title: 'Card 3' },
    // Add more card data as needed
  ];

  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 3,
    slidesToScroll: 3,
  };

  return (
    <div className="slick-track-container">
      <Slider {...settings}>
        {cardsData.map((card) => (
          <div key={card.id} className="card">
            <h2>{card.title}</h2>
            {/* Add other content for the card */}
          </div>
        ))}
      </Slider>
    </div>
  );
};

export default NineCardSlickTrack;
